import { BrowserRouter, Route } from "react-router-dom";
import './App.css';
import Signup from './register/Signup';
import Login from './register/Signup';

function App() {
  return (
    <Routes>
        <Route path="/register/signup" element={<Signup />} />
        <Route path="/register/login" element={<Login />}/>
    </Routes>
  );
}

export default App;
